import React from "react";
import { Container, Form, Navbar, Nav, NavDropdown } from "react-bootstrap";
const Mainpage = () => {
  return (
    <Form>
      <div class="container-fluid" expand="sm">
        <Navbar expand="sm">
          <Container style={{ alignContent: "start" }}>
            <Nav classname="me-auto">
              <Nav.Link href="Home">Home</Nav.Link>
              <Nav.Link href="/Book">Books</Nav.Link>
              <NavDropdown
                title="Electronics"
                id="basic-nav-dropdown"
                bg="primary"
              >
                <NavDropdown.Item href="/Mobile phone">
                  MobilePhone
                </NavDropdown.Item>
                <NavDropdown.Item href="/Desktop">Desktop Pc</NavDropdown.Item>
                <NavDropdown.Item href="/Laptop">Laptop</NavDropdown.Item>
              </NavDropdown>
            </Nav>
          </Container>
        </Navbar>
      </div>
    </Form>
  );
};

export default Mainpage;
